  input: TEXT,F3XA,,"This amended report responds to your letter dated September 27,
    2006.  In that letter you noted that Commericial Mortgage Securities Association
    ('CMSA') PAC failed to adequately identify the individuals who made contributions
    to CMSA PAC.  The amended report corrects this insufficiency and provides the
    missing information.  You also identified that the report failed to reflect the
    official name of the connected organization.  The amdended report now properly
    identifies the Commericial Mortgage Securities Associaiton PAC.  Finally, you
    noted in your letter that the report's beginning cash balance did not equal the
    ending cash balance of the 2005 Mid-Year Report.  Due to administrative error,
    an amended 2005 Mid-Year Report was not uploaded properly.  This resulted in the
    discrepency in cash on hand for the 2005 Mid-Year and Year-End reports.  That
    report has been uploaded.  We apologize for this oversight."
